import React from 'react';
import { Switch, Route, useRouteMatch } from 'react-router-dom';


const Identity = () => {
    const {path} = useRouteMatch();
    return (
        <Switch>
          <Route exact path={`${path}/login`}/>
          <Route exact path={`${path}/register`} />
        </Switch>
      );
}

export default Identity;
